// The helper function
// Reads the value of the switches and returns a number (0,1,2,3,4,5) accordingly

short int switchPower() {
    short int value = -1;
    if ((*swPtr & (0b01)) != 0) value = 0;
    if ((*swPtr & (0b10)) != 0) value = 1;
    if ((*swPtr & (0b100)) != 0) value = 2;
    if ((*swPtr & (0b1000)) != 0) value = 3;
    if ((*swPtr & (0b10000)) != 0) value = 4;
    if ((*swPtr & (0b100000)) != 0) value = 5;

    if (value == -1) return keyPushed(); //if not moving then check for shoot
    return value;
}

// The helper function
// Reads the edge capture reg of key 0 and returns if its 0 or 1

short int keyPushed() {
    short int value = -1; //Initialized it to a random number for testing
    if (((*keyEdgePtr) & (0b01)) == 1) { // Key 0
        value = 6;
    }
    if (((*keyEdgePtr) & (0b010)) == 2) { // Key 1
        value = 7;
        (*keyEdgePtr) = 0b010;
    }
    return value;
}

// Plots a pixel on the screen

void plot_pixel(int x, int y, short int line_color) {
    if (x >= screenWidth || x < 0 || y >= screenHeight || y < 0)
        printf("ERROR: Tried to draw out of bounds");
    else
        *(short int *) (pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

// Swaps two integers

void swap(int* a, int* b) {
    int temp = *a;
    *a = *b;
    *b = temp;
}

short int wait_for_vsync() {
    int status;
    volatile int * ctrl_reg = (int *) 0xFF203020;
    *(ctrl_reg) = 1;
    status = *(ctrl_reg + 3);
    short int switch_pressed = -1;
    while ((status & 0x1) != 0) { //doing polling while waiting for vsync this way save some cycles but have some input lag
        status = *(ctrl_reg + 3);
        switch_pressed = switchPower();
    }
    return switch_pressed;
}

void draw_line(int x0, int y0, int x1, int y1, short int line_color) {
    int absY = (y1 - y0);
    if (absY < 0) absY = absY * (-1);

    int absX = (x1 - x0);
    if (absX < 0) absX = absX * (-1);

    int is_steep = 0; //False
    if (absY > absX) is_steep = 1; //True

    if (is_steep) {
        swap(&x0, &y0);
        swap(&x1, &y1);
    }

    if (x0 > x1) {
        swap(&x0, &x1);
        swap(&y0, &y1);
    }

    int deltaX = (x1 - x0);
    int deltaY = (y1 - y0);
    if (deltaY < 0) deltaY = deltaY * (-1);
    int error = -(deltaX / 2);
    int y = y0;
    int y_step;

    if (y0 < y1) {
        y_step = 1;
    } else {
        y_step = -1;
    }

    for (int x = x0; x < x1; x++) {
        if (is_steep) {
            plot_pixel(y, x, line_color);
        } else {
            plot_pixel(x, y, line_color);
            error = error + deltaY;
        }
        if (error >= 0) {
            y = y + y_step;
            error = error - deltaX;
        }
    }
}

